/// @title AllFlagsAverageQuoter
/// @notice Calls StoixBridge with all sub-flags enabled and returns simple average
contract AllFlagsAverageQuoter is IQuoter {
    using Q64x64PriceMath for uint256;

    IDataBridge public immutable stoixBridge;

    constructor(address _stoixBridge) { stoixBridge = IDataBridge(_stoixBridge); }

    function quote(QuoteParams memory params, bytes memory) external override returns (uint256) {
        QuoteParams memory p = params;
        p.functionFlags = 0x7F; // all sub-flags
